import React, { useEffect, useState } from "react";
import { useCreateBookingMutation } from "../../redux/api/bookingApi";
import toast from "react-hot-toast";
import { useGetUsersQuery } from "../../redux/api/adminApi";
import { useGetFlightTypesQuery } from "../../redux/api/flightTypeApi";

const AddBookingForm = ({ setShowForm, refetch }) => {
  const [form, setForm] = useState({
    travelerId: "",
    travelerName: "",
    email: "",
    mobile: "",
    from: "",
    to: "",
    travelDate: "",
    travelTime: "",
    flightType: "",
    status: "pending",
    remarks: "",
    totalAmount: 0,
  });

  const { data: users } = useGetUsersQuery();
  const { data: flightTypes } = useGetFlightTypesQuery();
  const [createBooking] = useCreateBookingMutation();

  useEffect(() => {
    if (form.travelerId) {
      const user = users?.users?.find((u) => u._id === form.travelerId);
      if (user) {
        setForm((prev) => ({
          ...prev,
          travelerName: user.name,
          email: user.email,
          mobile: user.mobile,
        }));
      }
    }
  }, [form.travelerId, users]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createBooking(form).unwrap();
      toast.success("Booking created");
      refetch();
      setShowForm(false);
    } catch (err) {
      toast.error("Failed to create booking");
    }
  };

  return (
    <form onSubmit={handleSubmit} className="border p-3 mb-4 bg-light">
      <div className="row g-3">
        <div className="col-md-4">
          <select
            className="form-select"
            value={form.travelerId}
            onChange={(e) => setForm({ ...form, travelerId: e.target.value })}
            required
          >
            <option value="">Select Traveler</option>
            {users?.users?.map((u) => (
              <option key={u._id} value={u._id}>
                {u.name} ({u.email})
              </option>
            ))}
          </select>
        </div>
        <div className="col-md-4">
          <input
            className="form-control"
            placeholder="From"
            value={form.from}
            onChange={(e) => setForm({ ...form, from: e.target.value })}
            required
          />
        </div>
        <div className="col-md-4">
          <input
            className="form-control"
            placeholder="To"
            value={form.to}
            onChange={(e) => setForm({ ...form, to: e.target.value })}
            required
          />
        </div>
        <div className="col-md-4">
          <input
            type="date"
            className="form-control"
            value={form.travelDate}
            onChange={(e) => setForm({ ...form, travelDate: e.target.value })}
            required
          />
        </div>
        <div className="col-md-4">
          <input
            type="time"
            className="form-control"
            value={form.travelTime}
            onChange={(e) => setForm({ ...form, travelTime: e.target.value })}
            required
          />
        </div>
        <div className="col-md-4">
          <select
            className="form-select"
            value={form.flightType}
            onChange={(e) => setForm({ ...form, flightType: e.target.value })}
            required
          >
            <option value="">Select Flight Type</option>
            {flightTypes?.map((f) => (
              <option key={f._id} value={f.name}>
                {f.name}
              </option>
            ))}
          </select>
        </div>
        <div className="col-md-4">
          <input
            type="number"
            className="form-control"
            placeholder="Total Amount"
            value={form.totalAmount}
            onChange={(e) =>
              setForm({ ...form, totalAmount: parseFloat(e.target.value) })
            }
            required
          />
        </div>
        <div className="col-md-8">
          <textarea
            className="form-control"
            rows="2"
            placeholder="Remarks"
            value={form.remarks}
            onChange={(e) => setForm({ ...form, remarks: e.target.value })}
          />
        </div>
        <div className="col-md-12 d-flex gap-2 mt-2">
          <button type="submit" className="btn btn-success">
            Submit Booking
          </button>
          <button
            type="button"
            className="btn btn-secondary"
            onClick={() => setShowForm(false)}
          >
            Cancel
          </button>
        </div>
      </div>
    </form>
  );
};

export default AddBookingForm;
